import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from '@mui/material';

const ViewComplaintStatus = () => {
  const [complaints, setComplaints] = useState([]);
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const userEmail = queryParams.get('email');

  useEffect(() => {
    const fetchComplaints = async () => {
      if (!userEmail) return;

      try {
        const response = await axios.get('http://localhost:5000/api/complaints', {
          params: {
            email: userEmail,
          },
        });

        setComplaints(response.data);
      } catch (error) {
        console.error('Error fetching complaints:', error);
      }
    };

    fetchComplaints();
  }, [userEmail]);

  return (

    <div>

   
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
      }}
    >
      <Container sx={{ marginTop: 8, flexGrow: 1 }}>
        <Typography variant="h4" gutterBottom>
          Your Complaint Status
        </Typography>
        {complaints.length > 0 ? (
          <TableContainer component={Paper} sx={{ marginTop: 3, marginBottom: 4 }}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>
                    <strong>Complaint</strong>
                  </TableCell>
                  <TableCell>
                    <strong>Status</strong>
                  </TableCell>
                  <TableCell>
                    <strong>Lab</strong>
                  </TableCell>
                  <TableCell>
                    <strong>System Number</strong>
                  </TableCell>
                  <TableCell>
                    <strong>Date</strong>
                  </TableCell>
                  <TableCell>
                    <strong>Time</strong>
                  </TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {complaints.map((complaint) => (
                  <TableRow key={complaint._id}>
                    <TableCell>{complaint.complaint}</TableCell>
                    <TableCell>{complaint.status}</TableCell>
                    <TableCell>{complaint.lab}</TableCell>
                    <TableCell>{complaint.systemNumber}</TableCell>
                    <TableCell>{complaint.date}</TableCell>
                    <TableCell>{complaint.time}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        ) : (
          <Typography variant="body1" sx={{ marginTop: 2 }}>
            No complaints found.
          </Typography>
        )}
        <Box sx={{ mb: 4 }} /> {/* Adds 4 break spaces after the table */}
      </Container>

      <Box
        component="footer"
        sx={{
          py: 2,
          textAlign: 'center',
          backgroundColor: '#f1f1f1',
          width: '100%',
          mt: 'auto', // Pushes the footer to the bottom of the page
        }}
      >
        <Typography variant="body2" color="textSecondary">
          Â© 2024 LabFix. All rights reserved.
        </Typography>
      </Box>
    </Box>
    </div>
  );
};

export default ViewComplaintStatus;
